import React from "react";
import { Fragment } from "react/cjs/react.production.min";
import './logo.css';

const Logo=()=>{

    return(
        <Fragment>
            <div className="logo_container">
                <div className="circle"></div>
                <h1>PRI<div className="triangle"></div>NS_</h1>
            </div>
        </Fragment>
    );
}

export default Logo;
